[Form]
public class InventTransArchiveForm extends FormRun
{
    InventDimCtrl_Frm_ActiveRightClick inventDimFormSetup;
    boolean                            hasCachedDisplayMethods;



}

void init()
{
    super();       

    if (InventTransArchiveFeatureHelper::isFeatureEnabled())
    {
        element.design().caption("@SCM:ArchivedTransactionsCaption");
        InventTransArchivedDetails.text("@SCM:ArchivedInventTransDetailsTitleV2");
    }
    else
    {
        element.design().caption("@SCM:ArchivedTransactions");
    }

    element.updateDesign(InventDimFormDesignUpdate::Init);

    if (this.isCostingViewEnabled())
    {
        this.enableCostingView();
    }
}

private boolean isCostingViewEnabled()
{
    if (this.args() && this.args().caller())
    {
        if (this.args().menuItemName() == menuitemDisplayStr(CostInventTransAction)
            || this.args().menuItemName() == menuitemDisplayStr(CostInventTransProdAll))
        {
            return true;
        }

        if (this.args().caller() is CostIContextual)
        {
            CostIContextual contextProvider = this.args().caller() as CostIContextual;
            return contextProvider.isCostViewEnabled();
        }

        if (this.args().caller() is FormRun)
        {
            switch (this.args().caller().name())
            {
                case formStr(InventCostOnhandItem),
                     formStr(InventCostTrans),
                     formStr(InventSettlementRecord),
                     formStr(InventSettlementTrans),
                     formStr(InventSettlementVoucher):
                {
                    return true;
                }
            }
        }
    }

    return false;
}

private void enableCostingView()
{
    // Disable inventory fields
    InventTrans_DateFinancial.visible(false);
    INventTrans_DatePhysical.visible(false);
    InventTrans_Qty.visible(false);
    InventTableModule_UnitId.visible(false);
    InventTrans_PdsCWQty.visible(false);
    PdsCWUnitId.visible(false);
    CostValue.visible(false);
    CostValueSecCur_RU.visible(false);
    InventoryDimensionsGrid.visible(false);

     // Enable costing fields
    CostInventoryDimensionsGrid.visible(true);
    CostInventTrans_Qty.visible(true);
    CostInventTableModule_UnitId.visible(true);
    CostInventTransOrigin_InventTransId.visible(true);
    CostInventTrans_ValueOpen.visible(true);
    CostInventTrans_CostAmountSettled.visible(true);
    CostInventTrans_QtySettled.visible(true);
    CostInventTrans_CostAmountAdjustment.visible(true);
    CostInventTrans_CostAmountPosted.visible(true);
    CostInventTrans_CostAmountPhysical.visible(true);
    InventTrans_MarkingRefInventTransOrigin.visible(true);
    InventTrans_ReturnInventTransOrigin.visible(true);
    InventTrans_TransferLotId.visible(true);
    InventTrans_IsNonFinancialTransfer.visible(true);
}

void updateDesign(InventDimFormDesignUpdate _mode)
{
    InventDimParm   inventDimParm;

    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init          :
            InventDimSetupGrid::initInventDimParmInventTrans(inventDimParm);

            if (!inventDimFormSetup)
            {
                inventDimFormSetup  = InventDimCtrl_Frm_ActiveRightClick::newFromForm(element);
            }
            inventDimFormSetup.parmDimParmVisibleGrid(inventDimParm);
            inventDimFormSetup.formSetControls(true);
    }
}

void init()
{
    super();

    if (element.args().dataset() == tableNum(InventTransArchiveProcessHistoryTable))
    {
        QueryBuildDataSource inventTransArchiveDS = inventTransArchive_DS.query().dataSourceTable(tableNum(InventTransArchive));
        inventTransArchiveDS.clearLinks();
        InventTransArchiveProcessHistoryTable inventTransArchiveProcessHistoryTable = element.args().record();
        inventTransArchiveDS.addRange(fieldNum(InventTransArchive, SessionId)).value(queryValue(inventTransArchiveProcessHistoryTable.SessionId));
        inventTransArchiveDS.addLink(fieldNum(InventTransOrigin, RecId), fieldNum(InventTransArchive, InventTransOrigin), inventTransOrigin_DS.name());
    }
    else
    {
        InventTransArchiveFormHelper::formQueryAddDynalink(inventTransOrigin_DS, inventTransArchive_DS, element.args());
    }         

    // Do not cache display methods more than once
    if (!hasCachedDisplayMethods)
    {
        inventTransArchive_DS.cacheAddMethod(tableMethodStr(InventTransArchive, isNonFinancialTransfer));
        inventTransArchive_DS.cacheAddMethod(tableMethodStr(InventTransArchive, transferInventTransId));
        hasCachedDisplayMethods = true;
    }
}

int active()
{
    int ret = super();

    inventDim_DS.active();
    element.enableButtons();

    return ret;
}

void executeQuery()
{
    if (element.args().dataset() != tableNum(InventTransArchiveProcessHistoryTable))
    {
        InventTransArchiveFormHelper::formQueryPreExecute(inventTransOrigin_DS, inventTransArchive_DS, element.args());
    }
    super();
}

int active()
{
    int ret = super();

    inventTransArchive_DS.active();

    return ret;
}

public void init()
{
    super();

    this.queryBuildDataSource().addLink(fieldnum(InventTransArchive, ItemId), fieldnum(InventTableModule, ItemId));
    this.queryBuildDataSource().addRange(fieldnum(InventTableModule,ModuleType)).value(queryValue(ModuleInventPurchSales::Invent));
}

public void init()
{
    super();

    InventDistinctProductExpanded::prepareInventDistinctProductDatasource(InventDistinctProductExpanded_DisplayProductNumber,
                                                                          this.queryBuildDataSource(),
                                                                          inventTransArchive_DS.name(),
                                                                          fieldNum(InventTransArchive, ItemId),
                                                                          InventDim_DS.name());
}
